ot;^18&quot;,536871276]],[&quot;^16&quot;,[1528,&quot;^@&quot;,false,536871276]],[&quot;^16&quot;,[1528,&quot;^F&quot;,1526,536871276]],[&quot;^16&quot;,[1528,&quot;^Y&quot;,1524,536871276]],[&quot;^16&quot;,[1528,&quot;^V&quot;,1524,536871276]],[&quot;^16&quot;,[1528,&quot;^U&quot;,1524,536871276]],[&quot;^16&quot;,[1528,&quot;^?&quot;,[&quot;^ &quot;],536871276]],[&quot;^16&quot;,[1528,&quot;^19&quot;,true,536871276]],[&quot;^16&quot;,[1528,&quot;^;&quot;,&quot;~u62b9b5bb-0e43-460f-a4d6-831dff29ddec&quot;,536871276]],[&quot;^16&quot;,[1529,&quot;^R&quot;,&quot;For a UI experiment, we’ll look at engagement with different variants of the new feature. For an experiment that aims to deliver more relevant results in the search experience, we’ll measure if members are finding more things to watch through search. In other types of experiments, we might focus on more technical metrics, such as the time it takes the app to load, or the quality of video we are able to provide under different network conditions.\\nid:: 62b9b5bb-f168-4d6e-8eaf-ee9c71cfff65&quot;,536871524]],[&quot;^16&quot;,[1529,&quot;^P&quot;,&quot;^18&quot;,536871277]],[&quot;^16&quot;,[1529,&quot;^@&quot;,false,536871277]],[&quot;^16&quot;,[1529,&quot;^F&quot;,1528,536871277]],[&quot;^16&quot;,[1529,&quot;^Y&quot;,1524,536871277]],[&quot;^16&quot;,[1529,&quot;^V&quot;,1524,536871286]],[&quot;^16&quot;,[1529,&quot;^U&quot;,1524,536871280]],[&quot;^16&quot;,[1529,&quot;^?&quot;,[&quot;^ &quot;,&quot;^1&lt;&quot;,&quot;62b9b5bb-f168-4d6e-8eaf-ee9c71cfff65&quot;],536871524]],[&quot;^16&quot;,[1529,&quot;^19&quot;,true,536871277]],[&quot;^16&quot;,[1529,&quot;^;&quot;,&quot;~u62b9b5bb-f168-4d6e-8eaf-ee9c71cfff65&quot;,536871277]],[&quot;^16&quot;,[1530,&quot;^R&quot;,&quot;ref:: [ref](https://hyp.is/TjesYvYdEey1rZvGh7TVPQ/netflixtechblog.com/what-is-an-a-b-test-b08cc1b57962)&quot;,536871298]],[&quot;^16&quot;,[1530,&quot;^P&quot;,&quot;^18&quot;,536871289]],[&quot;^16&quot;,[1530,&quot;^@&quot;,false,536871289]],[&quot;^16&quot;,[1530,&quot;^F&quot;,1529,536871289]],[&quot;^16&quot;,[1530,&quot;^Y&quot;,1524,536871289]],[&quot;^16&quot;,[1530,&quot;^V&quot;,1529,536871292]],[&quot;^16&quot;,[1530,&quot;^U&quot;,1524,536871298]],[&quot;^16&quot;,[1530,&quot;^?&quot;,[&quot;^ &quot;,&quot;^1?&quot;,&quot;[ref](https://hyp.is/TjesYvYdEey1rZvGh7TVPQ/netflixtechblog.com/what-is-an-a-b-test-b08cc1b57962)&quot;],536871298]],[&quot;^16&quot;,[1530,&quot;^K&quot;,[&quot;^15&quot;,[&quot;^1?&quot;]],536871298]],[&quot;^16&quot;,[1530,&quot;^19&quot;,true,536871289]],[&quot;^16&quot;,[1530,&quot;^;&quot;,&quot;~u62b9b5cd-b590-496d-b1ef-4ce86bbd9334&quot;,536871289]],[&quot;^16&quot;,[1531,&quot;^R&quot;,&quot;Suppose we look at the click through rate, measuring the fraction of members in each experience that clicked on a title. This metric alone may be a misleading measure of whether this new UI is a success, as members might click on a title in the Upside Down product experience only in order to read it more easily. In this case, we might also want to evaluate what fraction of members subsequently navigate away from that title versus proceeding to play it.\\nid:: 62b9b5d9-d807-4014-bb1e-ff8741dd82cf&quot;,536871680]],[&quot;^16&quot;,[1531,&quot;^P&quot;,&quot;^18&quot;,536871299]],[&quot;^16&quot;,[1531,&quot;^@&quot;,false,536871299]],[&quot;^16&quot;,[1531,&quot;^F&quot;,1529,536871302]],[&quot;^16&quot;,[1531,&quot;^Y&quot;,1524,536871299]],[&quot;^16&quot;,[1531,&quot;^V&quot;,1524,536871302]],[&quot;^16&quot;,[1531,&quot;^U&quot;,1524,536871305]],[&quot;^16&quot;,[1531,&quot;^?&quot;,[&quot;^ &quot;,&quot;^1&lt;&quot;,&quot;62b9b5d9-d807-4014-bb1e-ff8741dd82cf&quot;],536871680]],[&quot;^16&quot;,[1531,&quot;^19&quot;,true,536871299]],[&quot;^16&quot;,[1531,&quot;^;&quot;,&quot;~u62b9b5d9-d807-4014-bb1e-ff8741dd82cf&quot;,536871299]],[&quot;^16&quot;,[1532,&quot;^R&quot;,&quot;ref:: [ref](https://hyp.is/mmeIgvYdEeybNQfPcW4L8g/netflixtechblog.com/what-is-an-a-b-test-b08cc1b57962)&quot;,536871319]],[&quot;^16&quot;,[1532,&quot;^P&quot;,&quot;^18&quot;,536871308]],[&quot;^16&quot;,[1532,&quot;^@&quot;,false,536871308]],[&quot;^16&quot;,[1532,&quot;^F&quot;,1531,536871308]],[&quot;^16&quot;,[1532,&quot;^Y&quot;,1524,536871308]],[&quot;^16&quot;,[1532,&quot;^V&quot;,1531,536871309]],[&quot;^16&quot;,[1532,&quot;^U&quot;,1524,536871319]],[&quot;^16&quot;,[1532,&quot;^?&quot;,[&quot;^ &quot;,&quot;^1?&quot;,&quot;[ref](https://hyp.is/mmeIgvYdEeybNQfPcW4L8g/netflixtechblog.com/what-is-an-a-b-test-b08cc1b57962)&quot;],536871319]],[&quot;^16&quot;,[1532,&quot;^K&quot;,[&quot;^15&quot;,[&quot;^1?&quot;]],536871316]],[&quot;^16&quot;,[1532,&quot;^19&quot;,true,536871308]],[&quot;^16&quot;,[1532,&quot;^;&quot;,&quot;~u62b9b5eb-18db-40d4-9704-6a7b7b7665a7&quot;,536871308]],[&quot;^16&quot;,[1533,&quot;^R&quot;,&quot;we also look at more general metrics that aim to capture the joy and satisfaction that Netflix is delivering to our members. These metrics include measures of member engagement with Netflix: are the ideas we are testing helping our members to choose Netflix as their entertainment destination on any given night?\\nid:: 62b9b5f2-7801-45dd-8cd8-61588ef02b02&quot;,536871720]],[&quot;^16&quot;,[1533,&quot;^P&quot;,&quot;^18&quot;,536871322]],[&quot;^16&quot;,[1533,&quot;^@&quot;,false,536871322]],[&quot;^16&quot;,[1533,&quot;^F&quot;,1531,536871323]],[&quot;^16&quot;,[1533,&quot;^Y&quot;,1524,536871322]],[&quot;^16&quot;,[1533,&quot;^V&quot;,1524,536871323]],[&quot;^16&quot;,[1533,&quot;^U&quot;,1524,536871698]],[&quot;^16&quot;,[1533,&quot;^?&quot;,[&quot;^ &quot;,&quot;^1&lt;&quot;,&quot;62b9b5f2-7801-45dd-8cd8-61588ef02b02&quot;],536871720]],[&quot;^16&quot;,[1533,&quot;^19&quot;,true,536871322]],[&quot;^16&quot;,[1533,&quot;^;&quot;,&quot;~u62b9b5f2-7801-45dd-8cd8-61588ef02b02&quot;,536871322]],[&quot;^16&quot;,[1534,&quot;^R&quot;,&quot;ref:: [ref](https://hyp.is/rsGqVvYdEeymYY-5xmKOSw/netflixtechblog.com/what-is-an-a-b-test-b08cc1b57962)&quot;,536871335]],[&quot;^16&quot;,[1534,&quot;^P&quot;,&quot;^18&quot;,536871329]],[&quot;^16&quot;,[1534,&quot;^@&quot;,false,536871329]],[&quot;^16&quot;,[1534,&quot;^F&quot;,1533,536871329]],[&quot;^16&quot;,[1534,&quot;^Y&quot;,1524,536871329]],[&quot;^16&quot;,[1534,&quot;^V&quot;,1533,536871332]],[&quot;^16&quot;,[1534,&quot;^U&quot;,1524,536871335]],[&quot;^16&quot;,[1534,&quot;^?&quot;,[&quot;^ &quot;,&quot;^1?&quot;,&quot;[ref](https://hyp.is/rsGqVvYdEeymYY-5xmKOSw/netflixtechblog.com/what-is-an-a-b-test-b08cc1b57962)&quot;],536871335]],[&quot;^16&quot;,[1534,&quot;^K&quot;,[&quot;^15&quot;,[&quot;^1?&quot;]],536871335]],[&quot;^16&quot;,[1534,&quot;^19&quot;,true,536871329]],[&quot;^16&quot;,[1534,&quot;^;&quot;,&quot;~u62b9b600-1d3b-45b7-b51e-aa50b61c16f4&quot;,536871329]],[&quot;^16&quot;,[1535,&quot;^R&quot;,&quot;Because we create our control (“A”) and treatment (“B”) groups using random assignment, we can ensure that individuals in the two groups are, on average, balanced on all dimensions that may be meaningful to the test. Random assignment ensures, for example, that the average length of Netflix membership is not markedly different between the control and treatment groups, nor are content preferences, primary language selections, and so forth.&quot;,536871340]],[&quot;^16&quot;,[1535,&quot;^P&quot;,&quot;^18&quot;,536871336]],[&quot;^16&quot;,[1535,&quot;^@&quot;,false,536871336]],[&quot;^16&quot;,[1535,&quot;^F&quot;,1533,536871337]],[&quot;^16&quot;,[1535,&quot;^Y&quot;,1524,536871336]],[&quot;^16&quot;,[1535,&quot;^V&quot;,1524,536871337]],[&quot;^16&quot;,[1535,&quot;^U&quot;,1524,536871340]],[&quot;^16&quot;,[1535,&quot;^?&quot;,[&quot;^ &quot;],536871340]],[&quot;^16&quot;,[1535,&quot;^19&quot;,true,536871336]],[&quot;^16&quot;,[1535,&quot;^;&quot;,&quot;~u62b9b605-5b8f-4252-8a4f-f197d2cea3a3&quot;,536871336]],[&quot;^16&quot;,[1536,&quot;^R&quot;,&quot;ref:: [ref](https://hyp.is/5RHBpPYdEeydf1vq0NK_mA/netflixtechblog.com/what-is-an-a-b-test-b08cc1b57962)&quot;,536871347]],[&quot;^16&quot;,[1536,&quot;^P&quot;,&quot;^18&quot;,536871343]],[&quot;^16&quot;,[1536,&quot;^@&quot;,false,536871343]],[&quot;^16&quot;,[1536,&quot;^F&quot;,1535,536871343]],[&quot;^16&quot;,[1536,&quot;^Y&quot;,1524,536871343]],[&quot;^16&quot;,[1536,&quot;^V&quot;,1535,536871344]],[&quot;^16&quot;,[1536,&quot;^U&quot;,1524,536871347]],[&quot;^16&quot;,[1536,&quot;^?&quot;,[&quot;^ &quot;,&quot;^1?&quot;,&quot;[ref](https://hyp.is/5RHBpPYdEeydf1vq0NK_mA/netflixtechblog.com/what-is-an-a-b-test-b08cc1b57962)&quot;],536871347]],[&quot;^16&quot;,[1536,&quot;^K&quot;,[&quot;^15&quot;,[&quot;^1?&quot;]],536871347]],[&quot;^16&quot;,[1536,&quot;^19&quot;,true,536871343]],[&quot;^16&quot;,[1536,&quot;^;&quot;,&quot;~u62b9b60d-109b-4eaf-aac3-8ec4ecdd9905&quot;,536871343]],[&quot;^16&quot;,[1537,&quot;^R&quot;,&quot;Now we have more than one possible explanation for the increase in engagement: it could be the new product experience, it could be the hit title that’s all over social media, it could be both. Or it could be something else entirely. The key point is that we don’t know if the new product experience caused the increase in engagement.\\nid:: 62b9b615-a3e8-4495-a2ca-6b8f355c0944&quot;,536871746]],[&quot;^16&quot;,[1537,&quot;^P&quot;,&quot;^18&quot;,536871348]],[&quot;^16&quot;,[1537,&quot;^@&quot;,false,536871348]],[&quot;^16&quot;,[1537,&quot;^F&quot;,1535,536871351]],[&quot;^16&quot;,[1537,&quot;^Y&quot;,1524,536871348]],[&quot;^16&quot;,[1537,&quot;^V&quot;,1524,536871351]],[&quot;^16&quot;,[1537,&quot;^U&quot;,1524,536871354]],[&quot;^16&quot;,[1537,&quot;^?&quot;,[&quot;^ &quot;,&quot;^1&lt;&quot;,&quot;62b9b615-a3e8-4495-a2ca-6b8f355c0944&quot;],536871746]],[&quot;^16&quot;,[1537,&quot;^19&quot;,true,536871348]],[&quot;^16&quot;,[1537,&quot;^;&quot;,&quot;~u62b9b615-a3e8-4495-a2ca-6b8f355c0944&quot;,536871348]],[&quot;^16&quot;,[1538,&quot;^R&quot;,&quot;ref:: [ref](https://hyp.is/Og9q-PYeEeyYNqeVSMEnag/netflixtechblog.com/       // browser's history using window.history.replaceState(...),

      // the single page app to route accordingly.
      (function(l) {

          });
